import "./NavBar.css";
import {Link, Outlet} from "react-router-dom";

const NavBar = () => {
	return (
		<main>
			 <Link to="/">Estadistica</Link>
			<section>
				<Outlet />
			</section>
		</main>
	);
};

export default NavBar;
